import './App.css';

function App() {
  return (

    <div className="App">
      
      <nav>
        <Link className="App" to='/cardapio/cadastrar'>Cadastro</Link>
        <Link to='/cardapio/consultar'>Consulta</Link>
      </nav>

      <main>
        <Outlet></Outlet>
      </main>
    </div>
  );
}

export default App;
